You can use a switch statement to handle multiple choices. Here's an example:
System.out.println("You come across a fork in the road. Which way do you go?");
System.out.println("1. Left");
System.out.println("2. Right");
System.out.println("3. Straight");
int choice = scan.nextInt();
switch (choice) {
        System.out.println("You go left and find a treasure chest.");
        System.out.println("You go right and find a dragon.");
        System.out.println("You go straight and find a village.");
        System.out.println("Invalid choice.");
This way, you can have as many choices as you want, and you can have different outcomes for each choice. You can also add more cases to the switch statement if you want to have more choices.

